const Footer = () => {
  return (
    <footer className="footer w-full h-10 px-4 border-t border-gray-300 flex-shrink-0 flex items-center justify-center text-gray-600">
      <div className="text-sm">&copy; copyright 2020</div>
    </footer>
  );
};

export default Footer;
